const OnGoingCard = (props) => {
    return ( 
        <div style={{backgroundColor:props.color}} className="taskcard">
            <h2>{props.content}</h2>
            <div>
                <button className="start" onClick={sendOngoing}><i class="fa-solid fa-check fa-xl"></i></button>
                <button className="start"><i className="fa-solid fa-ban fa-xl"></i></button>
            </div>
            <p>{props.time}</p>
        </div>
     );
}
 
export default OnGoingCard;
